import React from "react";

const ProjectView = ({ selectedProject }) => {
    if (selectedProject === 'eaturveg') return <a href="https://iguannalin.github.io/eaturveg/">View Project</a>
    else if (selectedProject === 'spotify') return <a href="https://iguannalin.github.io/spotify-recently-added/">View Project</a>
    else if (selectedProject === 'filmotography') return <a href="https://annaylin.com/filmotography">View Project</a>
}

export default ProjectView;
